import React from "react";
import Container from "@mui/material/Container";
import Header from "./components/Header";
import Balance from "./components/Balance";
import TransactionList from "./components/TransactionList";

const App: React.FC = () => {
  return (
    <Container>
      <Header />
      <Balance />
      <TransactionList />
    </Container>
  );
};

export default App;
